-- ----------------------------
-- Table structure for refundrecords
-- ----------------------------
DROP TABLE IF EXISTS `refundrecords`;
CREATE TABLE `refundrecords`
(
    `refund_id`            int(0)                                                                                                      NOT NULL AUTO_INCREMENT COMMENT '退款记录ID，主键，自动递增',
    `user_id`              int(0)                                                                                                      NULL DEFAULT NULL COMMENT '用户ID，外键，关联Users表的user_id',
    `purchase_id`          int(0)                                                                                                      NULL DEFAULT NULL COMMENT '要退款的购买记录ID，外键，关联UserPurchases表的purchase_id',
    `refund_reason`        text CHARACTER SET utf8mb4 COLLATE utf8mb4_es_trad_0900_as_cs                                               NULL COMMENT '退款原因',
    `refund_status`        enum ('APPLIED','APPROVED','REJECTED','COMPLETED') CHARACTER SET utf8mb4 COLLATE utf8mb4_es_trad_0900_as_cs NULL DEFAULT 'APPLIED' COMMENT '退款状态（申请中、已同意、已拒绝、已完成退款）',
    `refund_request_time`  timestamp(0)                                                                                                NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '申请退款时间，默认当前时间戳',
    `refund_approval_time` timestamp(0)                                                                                                NULL DEFAULT NULL COMMENT '退款审批时间（如已批准）',
    `refunded_amount`      decimal(10, 2)                                                                                              NULL DEFAULT NULL COMMENT '退款金额',
    `admin_contacted`      tinyint(1)                                                                                                  NULL DEFAULT 0 COMMENT '标记是否已通知管理员处理退款',
    `create_time`          datetime(0)                                                                                                 NULL DEFAULT NULL COMMENT '创建时间',
    `is_delete`            int(0)                                                                                                      NULL DEFAULT NULL COMMENT '是否删除',
    PRIMARY KEY (`refund_id`) USING BTREE,
    INDEX `user_id` (`user_id`) USING BTREE,
    INDEX `purchase_id` (`purchase_id`) USING BTREE,
    CONSTRAINT `refundrecords_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`user_id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
    CONSTRAINT `refundrecords_ibfk_2` FOREIGN KEY (`purchase_id`) REFERENCES `userpurchases` (`purchase_id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB
  CHARACTER SET = utf8mb4
  COLLATE = utf8mb4_es_trad_0900_as_cs
  ROW_FORMAT = Dynamic;

