-- ----------------------------
-- Table structure for userconsumptions
-- ----------------------------
DROP TABLE IF EXISTS `userconsumptions`;
CREATE TABLE `userconsumptions`
(
    `consumption_id`     int(0)       NOT NULL AUTO_INCREMENT COMMENT '消费记录ID，主键，自动递增',
    `user_id`            int(0)       NULL DEFAULT NULL COMMENT '用户ID，外键，关联Users表的user_id',
    `consumption_time`   timestamp(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '消费时间，默认当前时间戳',
    `message_sent_count` int(0)       NULL DEFAULT NULL COMMENT '发送消息消耗的次数',
    `purchase_id`        int(0)       NULL DEFAULT NULL COMMENT '购买记录ID，如果消耗的是购买的次数，则引用购买记录ID，外键',
    `create_time`        datetime(0)  NULL DEFAULT NULL COMMENT '创建时间',
    `is_delete`          int(0)       NULL DEFAULT NULL COMMENT '是否删除',
    PRIMARY KEY (`consumption_id`) USING BTREE,
    INDEX `user_id` (`user_id`) USING BTREE,
    INDEX `purchase_id` (`purchase_id`) USING BTREE,
    CONSTRAINT `userconsumptions_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`user_id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
    CONSTRAINT `userconsumptions_ibfk_2` FOREIGN KEY (`purchase_id`) REFERENCES `userpurchases` (`purchase_id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB
  CHARACTER SET = utf8mb4
  COLLATE = utf8mb4_es_trad_0900_as_cs
  ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of userconsumptions
-- ----------------------------

-- ----------------------------
-- Table structure for userpurchases
-- ----------------------------
DROP TABLE IF EXISTS `userpurchases`;
CREATE TABLE `userpurchases`
(
    `purchase_id`            int(0)                                                                                     NOT NULL AUTO_INCREMENT COMMENT '购买记录ID，主键，自动递增',
    `user_id`                int(0)                                                                                     NULL DEFAULT NULL COMMENT '用户ID，外键，关联Users表的user_id',
    `package_id`             int(0)                                                                                     NULL DEFAULT NULL COMMENT '套餐ID，外键，关联CreditPackages表的package_id',
    `purchase_time`          timestamp(0)                                                                               NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '购买时间，默认当前时间戳',
    `credit_count_purchased` int(0)                                                                                     NULL DEFAULT NULL COMMENT '购买的次数总数',
    `transaction_id`         varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_es_trad_0900_as_cs                      NULL DEFAULT NULL COMMENT '交易订单号',
    `payment_status`         enum ('PAID','UNPAID','REFUNDED') CHARACTER SET utf8mb4 COLLATE utf8mb4_es_trad_0900_as_cs NULL DEFAULT 'UNPAID' COMMENT '支付状态（已支付、待支付、已退款等）',
    `create_time`            datetime(0)                                                                                NULL DEFAULT NULL COMMENT '创建时间',
    `is_delete`              int(0)                                                                                     NULL DEFAULT NULL COMMENT '是否删除',
    PRIMARY KEY (`purchase_id`) USING BTREE,
    INDEX `user_id` (`user_id`) USING BTREE,
    INDEX `package_id` (`package_id`) USING BTREE,
    CONSTRAINT `userpurchases_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`user_id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
    CONSTRAINT `userpurchases_ibfk_2` FOREIGN KEY (`package_id`) REFERENCES `creditpackages` (`package_id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB
  CHARACTER SET = utf8mb4
  COLLATE = utf8mb4_es_trad_0900_as_cs
  ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of userpurchases
-- ----------------------------

-- ----------------------------
-- Table structure for users
-- ----------------------------
DROP TABLE IF EXISTS `users`;
CREATE TABLE `users`
(
    `user_id`              int(0)                                                                 NOT NULL AUTO_INCREMENT COMMENT '用户ID，主键，自动递增',
    `openid`               varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_es_trad_0900_as_cs  NOT NULL COMMENT '微信授权登录后返回的openid，唯一标识用户',
    `email`                varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_es_trad_0900_as_cs  NULL DEFAULT NULL COMMENT '邮箱',
    `user_name`            varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_es_trad_0900_as_cs  NULL DEFAULT NULL COMMENT '用户真实名称',
    `nickname`             varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_es_trad_0900_as_cs  NULL DEFAULT NULL COMMENT '用户昵称，来源于微信',
    `avatar_url`           varchar(2083) CHARACTER SET utf8mb4 COLLATE utf8mb4_es_trad_0900_as_cs NULL DEFAULT NULL COMMENT '用户头像URL',
    `register_time`        timestamp(0)                                                           NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '注册/首次登录时间，默认当前时间戳',
    `last_login_time`      timestamp(0)                                                           NULL DEFAULT NULL COMMENT '\r\n\r\n最近登录时间',
    `initial_credit_count` int(0)                                                                 NULL DEFAULT 50 COMMENT '首次登录赠送的免费次数，默认值可以设定为50',
